import React from 'react';

const GuildChannels = () => {
  const channels = [
    {
      name: 'LinkedIn',
      description: 'Professional Network',
      icon: 'üíº',
      url: 'https://linkedin.com/in/vnshkumar',
      type: 'professional'
    },
    {
      name: 'GitHub',
      description: 'Code Repository',
      icon: 'üêô',
      url: 'https://github.com/vnshkumar',
      type: 'code'
    },
    {
      name: 'Email',
      description: 'Direct Message',
      icon: '‚úâÔ∏è',
      url: 'mailto:vnsh.kumar@email.com',
      type: 'direct'
    }
  ];

  return (
    <section id="contact" className="game-section guild-channels">
      <div className="container">
        <h2 className="section-title">Join the Guild</h2>
        <div className="guild-content">
          <p className="guild-message">Let's make something great.</p>
          <div className="guild-channels-list">
            {channels.map((channel) => (
              <a 
                key={channel.name}
                href={channel.url} 
                className={`channel-link ${channel.type}`}
                target="_blank"
                rel="noopener noreferrer"
              >
                <div className="channel-icon">{channel.icon}</div>
                <div className="channel-info">
                  <div className="channel-name">{channel.name}</div>
                  <div className="channel-desc">{channel.description}</div>
                </div>
                <div className="channel-status online"></div>
              </a>
            ))}
          </div>
        </div>
      </div>
    </section>
  );
};

export default GuildChannels;
